import React from "react";
import "./footer.css";

const Footer = ()=>{
    return(
        <footer>
            <div className="footer-container">
                <div className="footer-context-container">
                <div className="logo-container">
                    <h2 className="logo-text">Share<span>Pro</span></h2>
                </div>
                </div>
            </div>
        </footer>
    );
};

export default Footer;
